	return (
		<div className='Search'>
			<input type="text" placeholder='Kinolarni qidirish' onChange={(e) => 
				setSearch(movies.filter((movie) => movie.name.toLowerCase().includes(e.target.value.toLowerCase())))}/>
			<button>Barcha kinolar</button>
			<button>Mashhur kinolar</button>
			<button>Eng ko'p ko'rilgan kinolar</button>
		</div>
	)
}

